parts:
{
  "name": "UBX-SEC-SIG",
  "class_id": "0x27",
  "message_id": "0x09",
  "message_type": "periodic_polled",
  "description": "Signal security information",
  "payload_length": {
    "variable": {
      "base": 4,
      "formula": "4 + jamNumCentFreqs * 4"
    }
  },
  "fields": [
    {
      "byte_offset": 0,
      "name": "version",
      "data_type": "U1",
      "fixed_value": 2,
      "description": "Message version (0x02 for this version)"
    },
    {
      "byte_offset": 1,
      "name": "sigSecFlags",
      "data_type": "X1",
      "description": "Signal security flags, providing high-level jamming and spoofing detector information",
      "bit_fields": [
        {
          "bit_offset": 0,
          "num_bits": 1,
          "name": "jamDetEnabled",
          "description": "Flag indicates whether jamming detection is enabled"
        },
        {
          "bit_offset": 1,
          "num_bits": 2,
          "name": "jamState",
          "description": "Jamming state",
          "value_descriptions": {
            "0": "Unknown",
            "1": "No jamming indicated",
            "2": "Warning; jamming indicated"
          }
        },
        {
          "bit_offset": 3,
          "num_bits": 1,
          "name": "spfDetEnabled",
          "description": "Flag indicates whether spoofing detection is enabled"
        },
        {
          "bit_offset": 4,
          "num_bits": 3,
          "name": "spfState",
          "description": "Spoofing state",
          "value_descriptions": {
            "0": "Unknown",
            "1": "No spoofing indicated",
            "2": "Spoofing indicated",
            "3": "Spoofing affirmed"
          }
        }
      ]
    },
    {
      "byte_offset": 2,
      "name": "reserved0",
      "data_type": "U1",
      "reserved": true
    },
    {
      "byte_offset": 3,
      "name": "jamNumCentFreqs",
      "data_type": "U1",
      "description": "The number of center frequencies we provide jamming information for (subsequent messages)"
    },
    {
      "byte_offset": 4,
      "name": "jamStateCentFreq",
      "data_type": "X4",
      "description": "Jamming state of signals sharing a given center frequency",
      "repeating": {
        "count_field": "jamNumCentFreqs",
        "elements": [
          {
            "bit_fields": [
              {
                "bit_offset": 0,
                "num_bits": 24,
                "name": "centFreq",
                "data_type": "U24",
                "unit": "kHz",
                "description": "Center frequency in [kHz], floored to the nearest kHz multiple"
              },
              {
                "bit_offset": 24,
                "num_bits": 1,
                "name": "jammed",
                "data_type": "U1",
                "description": "Flag indicates whether signals on the given center frequency are considered jammed"
              }
            ]
          }
        ]
      }
    }
  ]
}
